import { TextField } from "@mui/material";

export default function GenericInputField(props) {
  const { label, helperText, errorStatus = false } = props;
  return (
    <TextField
      fullWidth
      error={errorStatus}
      id={label}
      label={label}
      variant="outlined"
      helperText={errorStatus ? helperText : ""}
      sx={{ padding: "5px" }}
    />
  );
}
